async def request_body_to_args(
    required_params: List[ModelField],
    received_body: Optional[Union[Dict[str, Any], FormData]],
) -> Tuple[Dict[str, Any], List[ErrorWrapper]]:
    values = {}
    errors = []
    if required_params:
        for field in required_params:
            if received_body is not None:
                if field.shape in sequence_shapes and isinstance(received_body, FormData):
                    values[field.name] = received_body.getlist(field.name)
                else:
                    values[field.name] = received_body.get(field.name)
                    if isinstance(values[field.name], list):
                        values[field.name] = values[field.name][-1]  # Only last value for non-sequence types
            if values[field.name] is None:  # Check if the value is still None after assignment
                if field.required:
                    errors.append(
                        ErrorWrapper(MissingError(), loc=("body", field.name))
                    )
                else:
                    values[field.name] = deepcopy(field.default)
            else:
                if field.shape in sequence_shapes and not isinstance(values[field.name], sequence_types):  # Handle repeated keys
                    values[field.name] = [values[field.name]]
    return values, errors
